/* Easy name change scripts */




	function hide(divname) { 
		document.getElementById(divname).style.display = 'none'; 
	} 
	
	function show(divname) { 
		document.getElementById(divname).style.display = ''; 
	} 

function ShowLoading() { //DOM

	if (document.getElementById){
		document.getElementById('prepage').style.visibility='visible';
	}else{
		if (document.layers){ //NS4
			document.prepage.visibility = 'visible';
		}
		else { //IE4
		document.all.prepage.style.visibility = 'visible';
		}
	}
}
function CheckLegal(events) { 
	var thediv = document.getElementById('legal_div');
    thediv.style.display  = 'none'; 
	if (events=='legally') {
		thediv.style.display  = ((events=='legally') || (events==''))?'block':'none'; // Assign style  
	}
 } 
 
 function CheckDate(events) { 
	var caldiv = document.getElementById('future_date');
    caldiv.style.display  = 'none'; 
	switch(events){
		case 'Custom':
		    caldiv.style.display  = ((events=='Custom') || (events==''))?'block':'none'; // Assign style  
			return;
	}	
 } 
 function ShowFax(events) { 
	var faxdiv = document.getElementById('fax_div');
    faxdiv.style.display  = 'none'; 
	switch(events){
		case 'Yes':
		    faxdiv.style.display  = ((events=='Yes') || (events==''))?'block':'none'; // Assign style  
			return;
	}	
 } 
function msieversion() {

	  var ua = window.navigator.userAgent;
	  var msie = ua.indexOf("MSIE ");

	  if (msie > 0 || !!navigator.userAgent.match(/Trident.*rv\:11\./))      // If Internet Explorer, return version number
			return parseInt(ua.substring(msie + 5, ua.indexOf(".", msie)));
	  else                 // If another browser, return 0
			return 0
}